import Nav from 'react-bootstrap/Nav';
import '../css/Navbar.css';
import React from 'react';

function Navbar() {

    const nav_items_left = [
        {title: "Hem",              id: "home"},
        {title: "Pub & Event",      id: "events"},
        {title: "Klubbmästeriet",   id: "km"},
        {title: "Kontakt",          id: "contact"}
    ];

    const nav_items_right = [
        {title: "Logga in", id: "login"},
    ];

    const content_left = nav_items_left.map((item) => NavItem(item.title, item.id));
    const content_right = nav_items_right.map((item) => NavItem(item.title, item.id));

    return (
        <Nav className={"clearfix"}>
            <div className={"left"}>
                {content_left}
            </div>

            <div className={"right"}>
                {content_right}
            </div>
        </Nav>
    )
}

function NavItem(title, id){
    return (
        <Nav.Item>
            <Nav.Link activeKey={id} href={"#"+id}> {title} </Nav.Link>
        </Nav.Item>
    )
}

export default Navbar
